export function loginUser(username) {
  return new Promise((resolve, reject) => {
    // Replace this with your actual login logic
    // For example, you can make an API call to your back-end for authentication
    // and resolve the promise based on the response

    console.log(username)

    // Simulating a successful login
    if (username === 'admin') {
      resolve(true);
    } else {
      resolve(false);
    }
  });
}
